import React from "react";
import { Link } from "react-router-dom";

const Nav = (props) => {
  return (
    <div>
        <Link className='' to='/'>
            Home
        </Link>
        <Link to='/about'>
            About
        </Link>
        <Link to='/itinerary'>
            Itinerary
        </Link>
        <Link to='/faqs'>
            FAQs
        </Link>
        <Link to='/rsvp'>
            RSVP
        </Link>
    </div>
  );
};

export default Nav;
